            token:'',
            image:'',
            email:'',
            name:'',
        }
    }
    componentDidMount(){
        this.setState({
            email:this.props.u
        })
    }

    render(){
        return (
            <div>
                    <Nav email={this.state.email}/>
            </div>
        );
    }
}
